import React from "react";

export const CompletedTime = ({task}) => {
    return (
        <div>
            {task.completedTask ? Object.values(task.completedTask).map(completedTask => {
                return (
                    <div>
                        Completed Time
                        <span>{completedTask.completedTaskDay}</span>
                        <span>{completedTask.completedTaskTime}</span>
                    </div>
                )

            }) : null}
        </div>
    )
}
